import React from 'react';
import TextField from '@mui/material/TextField';
import Grid from '@mui/material/Grid';

const JournalFormTitle = ({ title, handleTitleChange }) => {
  return (
    <Grid item xs={12}>
      <TextField
        label="Title"
        value={title}
        onChange={handleTitleChange}
        fullWidth
      />
    </Grid>
  );
};

export default JournalFormTitle;
